            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Wednesday') {
          const exercise1 = {
            type: '01',
            name: 'BACK',
            count: startingCount + countIncrement
          };
          const exercise2 = {
            type: '02',
            name: 'SHOULDERS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Thursday') {
          const exercise1 = {
            type: '01',
            name: 'ABS',
            count: startingCount + countIncrement
          };
          const exercise2 = {
            type: '02',
            name: 'ARMS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Friday') {
          const exercise1 = {
            type: '01',
            name: 'CHEST',
            count: startingCount + countIncrement
          };
          const exercise2 = {
            type: '02',
            name: 'LEGS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Saturday') {
          const exercise1 = {
            type: '01',
            name: 'BACK',
            count: startingCount + countIncrement
          };
          const exercise2 = {
            type: '02',
            name: 'ABS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        monthDetail.details.push(dayDetail);
