  createUserData(){
    interface Exercise {
      type: string;
      name: string;
      count: number;
    }
    interface DayType {
      type: string;
      name: string;
    }
    interface DayDetail {
      day: number;
      dayName: string;
      checkIn: string;
      completed: string;
      dateString: string;
      sampleString: string;
      today:boolean;
      exercises: Exercise[];
      dayTypes: DayType[];
    }
    interface MonthDetail {
      month: string;
      details: DayDetail[];
    }
    const monthDetails: MonthDetail[] = [];
    const today = new Date();
    const currentMonth = today.getMonth();
    const currentYear = today.getFullYear();
    const currentDay = today.getDate();
    let dayCount = 1;
    let startingCount = 10;
    for (let month = currentMonth; month < 12; month++) {
      const date = new Date(currentYear, month, 1);
      const monthName = date.toLocaleString('en-us', { month: 'long' });
      const daysInMonth = new Date(currentYear, month + 1, 0).getDate();
      const monthDetail: MonthDetail = {
        month: monthName,
        details: []
      };
      const startDay = (month === currentMonth) ? currentDay : 1;
      let weekCount = 0;
      let countIncrement = 0;
      for (let day = startDay; day <= daysInMonth; day++) {
        const dateString = `${month + 1}-${day}-${currentYear}`;
        const sampleString = `ShapeShifting LOG for ${dateString}`;
        const dayName = new Date(currentYear, month, day).toLocaleString('en-us', { weekday: 'long' });
        const dayDetail: DayDetail = {
          day: dayCount,
          dayName,
          dateString,
          sampleString,
          dayTypes: [],
          exercises: [],
          checkIn: '',
          completed: '',
          today: day === today.getDate()
        };
        if (dayName === 'Sunday') {
          const exercise: Exercise = {
            type: '00',
            name: 'REST',
            count: 0
          };
          const Type: DayType = {
            type: '00',
            name: 'REST'
          };
          dayDetail.exercises.push(exercise);
          dayDetail.dayTypes.push(Type);
        }
        if (dayName === 'Monday') {
          weekCount++;
          if (weekCount > 1) {
            countIncrement += 2;
          }
          const exercise1: Exercise = {
            type: '01',
            name: 'CHEST',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'ARMS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Tuesday') {
          const exercise1: Exercise = {
            type: '01',
            name: 'ABS',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'LEGS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Wednesday') {
          const exercise1: Exercise = {
            type: '01',
            name: 'BACK',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'SHOULDERS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Thursday') {
          const exercise1: Exercise = {
            type: '01',
            name: 'ABS',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'ARMS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Friday') {
          const exercise1: Exercise = {
            type: '01',
            name: 'CHEST',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'LEGS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        if (dayName === 'Saturday') {
          const exercise1: Exercise = {
            type: '01',
            name: 'BACK',
            count: startingCount + countIncrement
          };
          const exercise2: Exercise = {
            type: '02',
            name: 'ABS',
            count: startingCount + countIncrement
          };
          dayDetail.exercises.push(exercise1, exercise2);
        }
        monthDetail.details.push(dayDetail);
        dayCount++;
      }
      monthDetails.push(monthDetail);
    }
    console.log(monthDetails);
    const storedMonthDetails = localStorage.getItem('monthDetails');
    if (storedMonthDetails) {
      const parsedMonthDetails = JSON.parse(storedMonthDetails);
